import React from 'react';
import './App.css';
import Toolbar from './components/Toolbar/Toolbar'

function App() {
  return (
    <div>
      <Toolbar/>
      <div style={{marginTop:'75px'}}>
        <h1>This is content</h1>
      </div>
    </div>
  );
}

export default App;
